var stuff = {};

var minX = Math.min(...input.map(i => i.x || i.xmin));
var maxX = Math.max(...input.map(i => i.x || i.xmax));

var minY = Math.min(...input.map(i => i.y || i.ymin));
var maxY = Math.max(...input.map(i => i.y || i.ymax));


function xyToIndex(x, y) {
	var ix = x - minX;
	var iy = y - minY;
	
	return ix + iy * (maxX - minX + 1);
}

for(var i = 0; i < input.length; i++) {
	var vein = input[i];
	
	if(vein.x) {
		for(var y = vein.ymin; y <= vein.ymax; y++) {
			stuff[xyToIndex(vein.x, y)] = '#';
		}
	} else {
		for(var x = vein.xmin; x <= vein.xmax; x++) {
			stuff[xyToIndex(x, vein.y)] = '#';
		}
	}
}

function simulateWater(flow) {
	var x = flow.x;
	var y = flow.y;
	
	var newFlows = [];
	
	if (y > maxY) {
		return newFlows;
	}
	
	var current = stuff[xyToIndex(x, y)];
	
	if (!current) {
		stuff[xyToIndex(x, y)] = '|';
	} else {
		if(current != '|') {
			return newFlows;
		}
	}

	var below = stuff[xyToIndex(x, y+1)];
	
	if (below != '#' && below != '~') {
		newFlows.push({x: x, y: y+1});
	} else {
		var rightClosed = true;
rl:		for(var px = x+1; ; px++) {
			var prospect = stuff[xyToIndex(px, y)];
			var belowprospect = stuff[xyToIndex(px, y+1)];
			if (prospect == '#' || prospect == '~') {
				break rl;
			}
			if (!prospect) {
				stuff[xyToIndex(px, y)] = '|';
			}
			if (belowprospect != '#' && belowprospect != '~') {
				newFlows.push({x: px, y: y+1});
				rightClosed = false;
				break rl;
			}
		}
		
		var leftClosed = true;
ll:		for(var px = x-1; ; px--) {
			var prospect = stuff[xyToIndex(px, y)];
			var belowprospect = stuff[xyToIndex(px, y+1)];
			if (prospect == '#' || prospect == '~') {
				break ll;
			}
			if (!prospect) {
				stuff[xyToIndex(px, y)] = '|';
			}
			if (belowprospect != '#' && belowprospect != '~') {
				newFlows.push({x: px, y: y+1});
				leftClosed = false;
				break ll;
			}
		}
		
		if (rightClosed && leftClosed) {
			for(var px = x; stuff[xyToIndex(px, y)] != '#'; px++) {
				stuff[xyToIndex(px, y)] = '~';
			}
			for(var px = x-1; stuff[xyToIndex(px, y)] != '#'; px--) {
				stuff[xyToIndex(px, y)] = '~';
			}
		}
		
		if (newFlows.length == 0) {
			newFlows.push({x: x, y: y-1});
		}
	}
	
	return newFlows;
}

function display(c) {
	if(c) {
		console.clear();
	}
	for(var y = minY; y <= maxY; y++) {
		var line = '';
		for(var x = minX; x <= maxX; x++) {
			line += stuff[xyToIndex(x, y)] || '.';
		}
		console.log(line);
	}
	console.log('water tiles: ' + waterTiles);
	console.log('flow tiles: ' + flowTiles);
	console.log('iterations: ' + iters);
}

function countWater() {
	var waterCount = 0;
	var flowCount = 0;
	
	for(var k in stuff) {
		var v = stuff[k];
		
		if (v == '|') {
			flowCount++;
		}
		if (v == '~') {
			waterCount++;
		}
	}
	
	return { water: waterCount, flow: flowCount };
}

var waterTiles = 0;
var flowTiles = 0;
var iters = 0;

var streams = [{x: 500, y: minY }];

while(streams.length > 0) {
	var newStreams = [];
	
	for(var i = 0; i < streams.length; i++) {
		newStreams.push(...simulateWater(streams[i]));
	}
				
	streams = newStreams;
	iters++;
}

var count = countWater();
waterTiles = count.water;
flowTiles = count.flow;

display(true);